import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className="contact">
        <div className="address">
          <i class="fas fa-map-marker-alt"></i>
          <a href="" target="_blank">
            Jomas Iela
          </a>
        </div>
      </div>
    </div>
  );
};

export default Footer;
